@use '../variables' as *;

/* reset styles */
* {
  color: inherit;
  margin: 0;
}

body {
  padding: 1rem;
}

h1, h2, h3, h4, h5, h6 {
  font-size: $base-font-size;
  margin: 0;
  padding: 0;
}

body {
  font-family: $base-font-family;
}

ul {
  padding: 0;
  list-style-type: none;
}

a {
  text-decoration: none;
}

hr {
  border: 0;
  border-top: 1px dotted #efefef;
}

img {
  max-width: 100%;
}

sources.scss\\variables\\_variables.scss:
// Theme colors
$primary: #326dee;
$secondary: #1ac888;
$error: #d32752;
$info: #f6c31c;

// Color palette
$colors: (
    "primary": $primary,
    "secondary": $secondary,
    "error": $error,
    "info": $info,
    "red": #e61919,
    "orange": #ffa600,
    "yellow": #e6e619,
    "green": #19e635,
    "blue": #1919e6,
    "purple": #9900ff,
    "grey": #808080,
    "black": black,
    "white": white
);

// Fonts
$base-font-family: 'Nunito', sans-serif;
$base-font-size: 1rem;
$font-scale: 1.25;
$font-size-sm: $base-font-size * 0.75;
$font-size-md: $base-font-size;
$font-size-lg: $base-font-size * 1.5;
$font-size-xl: $base-font-size * 2;
$font-size-xxl: $base-font-size * 3;

// Spacing
$base-padding: 0.75rem;
$base-margin: 0.75rem;

// Borders
$base-border-thickness: 4px;
$base-border-radius: 10px;

// Box-shadow
$base-box-shadow: 1px 3px 5px rgba(0,0,0,0.1);

sources.scss\\components\\_button.scss:
@use '../variables' as *;
@use './functions' as *;

@mixin btn($bg-color: #e2e2e2) {
    text-decoration: none;
    cursor: pointer;
    display: inline-block;
    border: 0;
    padding: $base-padding $base-padding * 2;
    border-radius: $base-border-radius;
    background-color: $bg-color;
}

.btn {
    @include btn;
}

@each $key, $val in $colors {
    .btn-#{$key} {
        @include btn($val);
        &:hover {
            background-color: lighten($val, 5%);
        }
    }

    .btn-outlined-#{$key} {
        @include btn(#fff);
        border: $base-border-thickness solid $val;
        &:hover {
            background-color: $val;
        }
    }

    .btn-complement-#{$key} {
        @include btn($val);
        color: light-comp($val);
        &:hover {
            color: $val;
            background-color: light-comp($val);
        }
    }
}

